#!/usr/bin/env python3\nprint(\"🔧 Quick data test...\")\n\ntry:\n    from tools.ga4_data_parser import GA4DataParser\n    from tools.data_storage_manager import DataStorageManager\n    import pandas as pd\n    from pathlib import Path\n    \n    # Test data loading\n    data_file = Path(\"data/events_ga4.ndjson\")\n    if data_file.exists():\n        print(f\"✅ Data file exists: {data_file}\")\n        \n        parser = GA4DataParser()\n        raw_data = parser.parse_ndjson(str(data_file))\n        print(f\"✅ Parsed {len(raw_data)} events\")\n        \n        # Test storage\n        storage_manager = DataStorageManager()\n        storage_manager.store_events(pd.DataFrame(raw_data))\n        \n        stored = storage_manager.get_data('events')\n        if stored is not None and not stored.empty:\n            print(f\"✅ Storage works: {len(stored)} events stored\")\n        else:\n            print(\"❌ Storage failed: no data\")\n    else:\n        print(f\"❌ Data file not found: {data_file}\")\n        \nexcept Exception as e:\n    print(f\"❌ Error: {e}\")\n    import traceback\n    traceback.print_exc()\n\nprint(\"Done.\")"